import React from 'react';
import './App.css';
import Header from './Header';
import Footer from './Footer';
import About from './About';
import Artwork from './Artwork';

function MainApp() {
  return (
    <div className="App">
      <div className="animated-bg" aria-hidden="true"></div>
      <div className="content">
        <Header />
        <About />

      </div>
    </div>
  );
}

function App() {
  return <MainApp />;
}

export default App;
